eval("module.exports = JSON.parse('[{\"id\":1,\"category\":\"Dev Practices\",\"title\":\"Documentation\",\"description\":\"How good are your docs? How trusted are they?\",\"high_score\":\"Our docs are updated regularly and are accurate\",\"low_score\":\"Documentation is poor, out of date or non-existant\",\"more_info_link\":null,\"important\":null,\"seq\":1},{\"id\":2,\"category\":\"Dev Practices\",\"title\":\"IaC\",\"description\":\"How much do you follow Infrastructure as Code practices\",\"high_score\":\"We use versioned and tested IaC for all our deployments.  It is kept alongside the code or in a dedicated and well documented repo.  Manual processes are far and few-between and well documneted\",\"low_score\":\"Our deployments are full on manual ClickOps\",\"more_info_link\":null,\"important\":null,\"seq\":null},{\"id\":3,\"category\":\"Dev Practices\",\"title\":\"QA and confidence\",\"description\":\"How easy is it to provide confidence that the changes that are made are correct (technically and functionally)\",\"high_score\":\"We have multiple assurance steps of differing types run in multiple environments as part of our CI & CD processes.  We use fault injection to find areas of weakness to improve\",\"low_score\":\"\\\\\"We only have basic unit or \\\\\"\\\\\"integration tests\\\\\"\\\\\" in place\\\\\"\",\"more_info_link\":null,\"important\":null,\"seq\":null},{\"id\":4,\"category\":\"Observability\",\"title\":\"Service status\",\"description\":\"How do we display the current service/system status to ops teams and business stakeholders\",\"high_score\":\"We build a dashboard in collaboration with the operations and business teams. UX is a key consideration\",\"low_score\":\"Operations teams tend to discover the status indicators themselves\",\"more_info_link\":null,\"important\":null,\"seq\":1},{\"id\":5,\"category\":\"Deployments\",\"title\":\"Service KPIs/SLOs\",\"description\":\"How do we track the main service/system Key Performance Indicators (KPIs) or Service Level Objectives (SLOs)? What are the KPIs/SLOs?\",\"high_score\":\"We emit service KPIs/SLIs for each of our components that are picked up by a dashboard/alerting mechanism.  We review and optimise for them constantly\",\"low_score\":\"We do not have Service KPIs/SLOs defined\",\"more_info_link\":null,\"important\":null,\"seq\":1},{\"id\":6,\"category\":\"Deployments\",\"title\":\"Blue-Green\",\"description\":\"Any mechanism to test a new version alongside an existing version when necessary\",\"high_score\":\"We use fine-grained blue-green deployment techniques, at the level of individual services\",\"low_score\":\"We do not use any blue-green deployment techniques\",\"more_info_link\":null,\"important\":null,\"seq\":1},{\"id\":7,\"category\":\"Deployments\",\"title\":\"Automated config\",\"description\":\"Config should always be performed by an automated process using values from your configuration repository\",\"high_score\":\"All config is done using scripts\",\"low_score\":\"Many of our applications are configure manually each time\",\"more_info_link\":null,\"important\":null,\"seq\":1},{\"id\":8,\"category\":\"Deployments\",\"title\":\"Environment history\",\"description\":\"It should be possible to clearly see a history and log of changes made to our environments\",\"high_score\":\"We have a nice dashboard of deployments and their impact\",\"low_score\":\"It is difficult to see the history of changes in an environment\",\"more_info_link\":null,\"important\":null,\"seq\":1},{\"id\":9,\"category\":\"Availability\",\"title\":\"Service KPIs/SLOs\",\"description\":\"How do we track the main service/system Key Performance Indicators (KPIs) or Service Level Objectives (SLOs)? What are the KPIs/SLOs?\",\"high_score\":\"We emit service KPIs/SLIs for each of our components that are picked up by a dashboard/alerting mechanism.  We review and optimise for them constantly\",\"low_score\":\"We do not have Service KPIs/SLOs defined\",\"more_info_link\":null,\"important\":null,\"seq\":1},{\"id\":10,\"category\":\"Availability\",\"title\":\"Service restoration and DR\",\"description\":\"How do we keep things up and running: Can you recover quickly from incidents a low MTTR? Can you detect incidents ahead of time? Can you failover to backup systems\",\"high_score\":\"We have fully adopted SRE practices across the board. We continuously monitor and improve on your numbers\",\"low_score\":\"Little to no availability practices\",\"more_info_link\":null,\"important\":null,\"seq\":1},{\"id\":11,\"category\":\"Availability\",\"title\":\"Observability\",\"description\":\"How much observability do you have on your systems environments, inputs, outputs and behaviour. Do you have enough information on how your system runs to make improvements/solve problems?\",\"high_score\":\"Just the basics you get for free from Cloudwatch, an on-server agent, htop, task manager etc.\",\"low_score\":\"Max Instrumentation and SLO driven dashboards\",\"more_info_link\":null,\"important\":null,\"seq\":1},{\"id\":12,\"category\":\"Availability\",\"title\":\"Run without you\",\"description\":\"If all of your team took some time off, how long would your systems keep running without you?\",\"high_score\":\"Our prod env will run for weeks without interference and self-heal.  We have evegreen well tested runbooks for all critical services\",\"low_score\":\"Everything will fall on it\\'s face within a day without our heroics\",\"more_info_link\":null,\"important\":null,\"seq\":1},{\"id\":13,\"category\":\"Culture\",\"title\":\"Path to production\",\"description\":\"How easy is it to release the software that you work to production\",\"high_score\":\"It\\'s easy and straightforward to release my changes\",\"low_score\":\"It\\'s very difficult to release and takes a long time\",\"more_info_link\":null,\"important\":null,\"seq\":2},{\"id\":14,\"category\":\"Culture\",\"title\":\"Learning\",\"description\":\"How much do you learn as a team?\",\"high_score\":\"We learn something every day\",\"low_score\":\"We rarely learn something new\",\"more_info_link\":null,\"important\":null,\"seq\":1},{\"id\":15,\"category\":\"Culture\",\"title\":\"Definition of done\",\"description\":\"Done means released into production and not causing problems\",\"high_score\":\"Done means that the changes are deployed to prod with monitoring to ensure it has not broken anything\",\"low_score\":\"Our definition of done is a bit wishy-washy and means “feature tests have passed”\",\"more_info_link\":null,\"important\":null,\"seq\":1},{\"id\":16,\"category\":\"Culture\",\"title\":\"Onboarding\",\"description\":\"How easy is it to onboard members to your team and make them productive\",\"high_score\":\"New team members can spin up a environment quickly and commit to production < 3 weeks\",\"low_score\":\"It can take a few months before a team member can actively contribute\\\\n\\\\nIt takes a long time to discover all the codebases and environments\",\"more_info_link\":null,\"important\":null,\"seq\":null},{\"id\":17,\"category\":\"Tech\",\"title\":\"Failure modes\",\"description\":\"How can we see and share the different known failure modes (failure scenarios) for the system?\",\"high_score\":\"We use a set of error identifiers to define the failure modes in our software and we use these identifiers in our log messages\",\"low_score\":\"We do not relaly know how the system might fail\",\"more_info_link\":null,\"important\":null,\"seq\":1},{\"id\":18,\"category\":\"Flow\",\"title\":\"Deployment frequency\",\"description\":\"How often does your team deploy to Production?\",\"high_score\":\"Every 2 days or less\",\"low_score\":\"Every 2 weeks or longer in practice\",\"more_info_link\":null,\"important\":null,\"seq\":1},{\"id\":19,\"category\":\"Infra\",\"title\":\"Impact assessment\",\"description\":\"How well do you understand the outcome / effect of the change ?\",\"high_score\":\"Our team is invovled very early in the conversations and we know how we will measure the impact  \",\"low_score\":\"We are normally told at the last minute\",\"more_info_link\":null,\"important\":null,\"seq\":null}]');\n\n//# sourceURL=webpack://devsecops-assessment/./src/data/cardData.json?");

